import React from 'react';
import Home from './Home';
import Service from './Service';
import Contact from './Contact';
import Footer from './Footer';
import './App.css';
import {NavLink} from 'react-router-dom'
import{ Switch,Redirect} from 'react-router-dom';
const App=props=>{

  return(

<body>

<div>
<a id='a1'>HariCharan</a>

<NavLink id='a2' to='/' style={{textDecoration:'none',marginLeft:'300px'}}>Home</NavLink>
<NavLink id='a3' to='/Service' style={{textDecoration:'none'}}>Service</NavLink>
<NavLink id='a4' to='/Contact' style={{textDecoration:'none'}}>Contact</NavLink>
<br></br>

<Switch>
<Route exact path="/" component={Home}/>
<Route exact path="/Service" component={Service}/>
<Route exact path="/Contact" component={Contact}/>
<Redirect to='/' />

</Switch>
<Footer/>

</div>

</body>

  );
  }
export default App;
